window.bookSummaryJSON = "<p>THERE’S NO WAY BACK FROM WHAT WE’VE BECOME.</p> <p>There is no way back. There is no way. No way back. Not from what we’ve become; Bloodthirsty, vengeful, vile.</p> <p>Some women strive to make their men better, I VOW TO MAKE HIM WORSE.</p> <p>With each life we take, we fall deeper into our own sinister desires. We were never looking for a way out, but in this prison? There is no way back from what we’ve become.</p>"; 
